INSERT INTO `popular_science_info` VALUES (1, '乙肝疫苗科普', , '<p>乙肝，是由乙肝病毒感染肝脏引起的以急性或慢性肝脏炎症损伤为主要临床表现的传染性疾病。传染源为急、慢性乙肝患者和病毒携带者。急性乙肝或慢性乙肝急性发作，常见乏力疲劳、食欲不振、恶心厌油、右上腹疼痛，部分患者可见黄疸、发热，伴肝功能损伤。肝实质细胞炎症损伤持续存在或反复出现，是慢性乙肝病毒感染者进展为肝硬化甚至肝癌的重要因素。全球每年约有88.7万人死于乙肝病毒感染，其中肝硬化和肝癌的病死率分别占30%和45%。</p><p>人群对乙肝病毒普遍易感。感染的主要途径是血液及血液制品传播（包括皮肤和黏膜微小创伤）、母婴垂直传播和性传播。HBeAg阳性、乙肝病毒DNA高水平母亲的新生儿更易发生母婴传播。一般与乙肝患者或病毒携带者一起共餐、握手、拥抱等不会感染乙肝病毒。</p><p>预防乙肝，最经济最有效的办法就是接种乙肝疫苗。</p>', '2024-02-26 20:59:20', '2024-05-09 13:02:41');
INSERT INTO `popular_science_info` VALUES (3, '接种狂犬疫苗的小知识！', , '<p>狗抓伤没破皮，但红了，需不需要去打狂犬疫苗？</p><p>我家的猫不小心把我的手挠破皮了！我需要去打狂犬病疫苗吗？今天给大家科普一下打疫苗的知识~</p><p>1️⃣暴露级别</p><p>依据世界卫生组织推荐的指南，我国规范的狂犬病预防程序是按照“五针法”进行的，即在受伤后0、3、7、14和28天各接种一剂。具体来说，在发生狂犬病暴露后的第一时间内到医院接受专业医生评估，然后按计划完成全程接种。</p><p><br></p><p>2️⃣接种时间</p><p>通常建议被动物咬伤或抓伤后尽快到医院就诊，以便及时处理伤口并开始接种狂犬疫苗。如果未能及时处理，则应在发现伤口后尽快就医。根据不同情况可能需要调整接种时间及方式。</p><p><br></p><p>3️⃣接种部位</p><p>狂犬疫苗一般分左臂和右臂交替接种，每次接种时应选择不同部位以防局部硬结形成影响下次接种。若出现红肿可热敷促进其吸收；但不可搔抓以防感染扩散而加重病情发展速度。</p><p><br></p><p>4️⃣注射剂量</p><p>狂犬疫苗需按规定剂量按时注射才能产生有效抗体防御病毒入侵机体所致伤害。对于体重低于50公斤者可适当减少单次用量；孕妇及哺乳期妇女慎用以免对胎儿造成不良影响。</p><p><br></p><p>5️⃣免疫效果观察</p><p>全程接种完所有剂次后还需再过一段时间才能达到最佳保护水平哦~所以一定要注意观察身体变化哟~若有任何异常反应请及时向当地疾控中心报告并接受进一步检查与治疗呢！</p><p><br></p><p>6️⃣禁忌证</p><p>过敏体质者应谨慎使用本品，严重急性疾病患者禁用。此外还应注意避免与其他药物同时使用可能会产生的相互作用。</p>', '2024-02-26 20:59:20', '2024-05-09 12:54:09');
INSERT INTO `popular_science_info` VALUES (4, '流感疫苗，要不要打？', , '<p>由于流感病毒经常变异，当一种变异株流行时，人群抗体水平相应增加，流行株就会被抑制，而另种新变异株将逐渐成为流行株;当人群中新变异株的抗体水平增加，另一种新变异株又会出现，流行再次发生。</p><p><br></p><p>抗原不断漂移或转变，易感人群更迭，导致流行反复发生。</p><p><br></p><p>因此，有必要每年根据流行状况更换疫苗株，通过及时接种疫苗控制流感在人群中传播和流行。</p><p><br></p><p>世界卫生组织（WHO）每年都基于对下一个流行季节流感病毒流行株的预测结果，提出全球流感疫苗株的推荐意见。全球各国的疫苗企业根据WHO的预测结果生产当年的流感疫苗。</p><p><br></p><p>为保证接种人群得到最大程度地保护，即使流感疫苗组份与前一季节完全相同，鉴于多数接种者抗体滴度已显著下降，因此不管前一季节是否接种流感疫苗，仍建议在当年流感季节来临前接种。所以去年打了的，今年还需要再打。</p><p><br></p><p><br></p><p><br></p>', '2024-02-26 20:59:20', '2024-05-09 12:52:33');
INSERT INTO `popular_science_info` VALUES (5, 'HPV疫苗，哪个年龄段接种效果更好？', , '<p>HPV疫苗，可以说是人类第一种可以有效预防癌症的疫苗，不仅能有效预防因高危型HPV感染引起的宫颈癌，也能预防类似原因引起的肛门癌、阴茎癌等多种癌症。</p><p><br></p><p>也就是说，不论男女，都能通过接种HPV疫苗受益，只不过，目前世界大部分国家，包括中国在内，还是“女士优先”。</p><p><br></p><p>而对于女性朋友来说，大部分的宫颈癌（99.7%）都与HPV感染有关，通过接种疫苗，预防HPV感染，可以有效预防宫颈癌。</p>', '2024-02-26 20:59:20', '2024-05-09 12:51:06');
INSERT INTO `popular_science_info` VALUES (6, '预防宫颈癌，想不到二价苗更划算！', , '<p>小时候，经常会听到某某家人因为心血管疾病住医院，而感到无比惋惜、畏惧。</p><p><br></p><p>随着年龄的增长，这些疾病虽然也时有听说，但是不再是那么频繁，反而有一个疾病变得更加让我们恐惧，听的次数也更加频繁，它就是恶性肿瘤。</p><p><br></p><p>最近这段时间，宫颈癌疫苗很火，很多人都想打。</p><p><br></p><p>如果你平常关注宫颈癌疫苗，相信对疫苗也已经有了一定的了解，但以下几个问题，你不一定知道。</p><p><br></p><p>宫颈癌和HPV之间有什么关系？</p><p><br></p><p>答:HPV全名为人类乳头瘤病毒</p><p><br></p><p><br></p><p><br></p><p>有200多种，分为低危型和高危型</p><p>低危型HPV感染绝大部分会引起皮肤出现皮损的情况，比如出现赘生物等</p><p>高危型HPV感染在临床上如果是持续感染，有可能会导致宫颈上皮出现癌前病变，甚至会发展为宫颈癌症</p><p><br></p><p>在我国，84.5%的宫颈癌由 HPV 16型 和 18型 这两个高危型别感染有关。</p><p><br></p>', '2024-02-26 20:59:20', '2024-05-09 12:50:30');
INSERT INTO `popular_science_info` VALUES (7, '接种疫苗预防戊肝，老年戊肝伤不起！', , '<p>戊肝，是一种常见的<strong>传染</strong>性疾病。</p><p><br></p><p>日常生活中，吃了未煮熟的肉类、海产品，不干净的蔬菜水果，或者使用了受污染的餐具，都容易感染。</p><p><br></p><p>重症戊肝在临床上并不罕见，除了孕妇、患有基础肝病的患者、免疫力低下人群外，身体素质较差甚至还带有其他基础疾病的老年人也常是重症戊肝的受害者。</p><p><br></p><p>同为急性病毒性肝炎，甲肝好发于青年群体，而戊肝好发于中老年群体。</p><p><br></p><p>20岁后戊肝发病率快速上升，戊肝发病患者群主要为40岁以上的中老年男性，60岁以上老年患者的病死率显著高于其他年龄患者！</p><p><br></p><p>文献可查的我国多个戊肝暴发疫情发现，敬老院/养老机构的戊肝暴发频率较高。一项复旦大学针对上海市徐汇区戊肝监测的病例职业特征研究发现，离退休人员的占比最高！</p>', '2024-04-02 18:35:16', '2024-05-11 08:18:09');

