DROP TABLE IF EXISTS `vaccine_info`;
CREATE TABLE `vaccine_info`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `vc_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '疫苗编号',
  `vc_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '疫苗名称',
  `dose` int(11) NULL DEFAULT NULL COMMENT '剂次',
  `space_time` int(11) NULL DEFAULT NULL COMMENT '间隔时间 - 天',
  `price` decimal(10, 2) NULL DEFAULT NULL COMMENT '参考价格',
  `type` int(255) NULL DEFAULT NULL COMMENT '疫苗分裂',
  `place` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '预约地点',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 13 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

